// src/pages/driver/TripsPage.jsx
import React, { useState } from "react";

export default function TripsPage() {
  // Dummy trips
  const [incoming, setIncoming] = useState([
    { id: 1, from: "Colombo Fort", to: "Dehiwala", time: "10:30 AM" },
    { id: 2, from: "Borella", to: "Mount Lavinia", time: "11:00 AM" },
  ]);

  const [inProgress, setInProgress] = useState([
    { id: 3, from: "Nugegoda", to: "Kottawa", time: "09:15 AM" },
  ]);

  const [done, setDone] = useState([
    { id: 4, from: "Matara", to: "Galle", time: "08:00 AM" },
  ]);

  // Expand/collapse
  const [openTab, setOpenTab] = useState(null); // "incoming"|"inProgress"|"done"|null

  // Handlers to move trips between lists
  const acceptTrip = (trip) => {
    setIncoming((list) => list.filter((t) => t.id !== trip.id));
    setInProgress((list) => [...list, trip]);
  };

  const completeTrip = (trip) => {
    setInProgress((list) => list.filter((t) => t.id !== trip.id));
    setDone((list) => [...list, trip]);
  };

  const cancelTrip = (trip, listName) => {
    if (listName === "incoming") {
      setIncoming((list) => list.filter((t) => t.id !== trip.id));
    } else if (listName === "inProgress") {
      setInProgress((list) => list.filter((t) => t.id !== trip.id));
    }
    // done trips stay in history—no cancel button there
  };

  // Utility to render each card
  const renderCard = (
    title,
    list,
    listName,
    onAction,
    actionLabel,
    actionColor
  ) => {
    const isOpen = openTab === listName;
    return (
      <div className="bg-white bg-opacity-70 backdrop-blur-md rounded-xl shadow-lg">
        {/* Header */}
        <button
          className="w-full text-left px-5 py-4 flex justify-between items-center hover:bg-gray-100 rounded-t-xl"
          onClick={() => setOpenTab(isOpen ? null : listName)}
        >
          <span className="text-lg font-semibold">{title}</span>
          <span className="text-2xl font-bold">{list.length}</span>
        </button>

        {/* Expanded List */}
        {isOpen && (
          <div className="px-5 py-4 border-t">
            {list.length === 0 ? (
              <p className="text-gray-500">No trips here.</p>
            ) : (
              <ul className="space-y-3">
                {list.map((trip) => (
                  <li
                    key={trip.id}
                    className="flex justify-between items-center bg-white shadow rounded p-3"
                  >
                    <div>
                      <p className="font-medium">
                        {trip.from} → {trip.to}
                      </p>
                      <p className="text-sm text-gray-600">{trip.time}</p>
                    </div>
                    {/* Action Buttons */}
                    <div className="flex items-center space-x-2">
                      {listName !== "done" && (
                        <button
                          onClick={() =>
                            actionLabel === "Accept"
                              ? acceptTrip(trip)
                              : completeTrip(trip)
                          }
                          className={`px-3 py-1 rounded text-white text-sm bg-${actionColor}-500 hover:bg-${actionColor}-600 transition`}
                        >
                          {actionLabel}
                        </button>
                      )}
                      {listName !== "done" && (
                        <button
                          onClick={() => cancelTrip(trip, listName)}
                          className="px-3 py-1 rounded text-white text-sm bg-red-500 hover:bg-red-600 transition"
                        >
                          Cancel
                        </button>
                      )}
                    </div>
                  </li>
                ))}
              </ul>
            )}
          </div>
        )}
      </div>
    );
  };

  return (
    <div
      className="flex h-full overflow-hidden font-sans"
      style={{ fontFamily: "'Poppins', sans-serif" }}
    >
      <div className="flex-1 p-6 overflow-y-auto">
        <h2 className="text-2xl font-semibold mb-6">My Trips</h2>
        <div className="grid gap-6 sm:grid-cols-1 md:grid-cols-2 lg:grid-cols-3">
          {renderCard(
            "Incoming Trips",
            incoming,
            "incoming",
            acceptTrip,
            "Accept",
            "green"
          )}
          {renderCard(
            "In-Progress Trips",
            inProgress,
            "inProgress",
            completeTrip,
            "Complete",
            "blue"
          )}
          {renderCard("Done Trips", done, "done", null, "", "")}
        </div>
      </div>
    </div>
  );
}
